import React from "react";
import styled from "styled-components";
// css
const HeaderContaner = styled.div`
  background: #3c415e;
  margin: 0 auto;
  padding: 0 auto;
  ${"" /* width: 100%; */}
  display: flex;
  justify-content: space-around;
  color: white;

  ul {
    list-style: none;
    display: flex;
    margin: auto 0;
  }
  li {
    margin-left: 3rem;
  }
  .orangeBtn {
    background: tomato;
    padding: 0.3rem 1rem;
    border-radius: 5px;
  }
`;

function Header() {
  return (
    <HeaderContaner>
      <h2>Gurules</h2>
      <ul>
        <li>About</li>
        <li>Find Tutor</li>
        <li>Contact</li>
        <li>Dashboard</li>
        <li className="orangeBtn">Login</li>
      </ul>
    </HeaderContaner>
  );
}

export default Header;
